import React, {Component} from "react"

class History extends Component {
   render() {
      return (
         <div className="history">
            <p>Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!<br />Hello!</p>
         </div>
      )
   }
}

export default History
